import React from "react";
import {PropTypes} from 'prop-types';

const ReportBox = (props) => {
    const isNumber = props.report.type === 'NUMBERS' ? null : <div></div>;
    return (
        <div className="report-box">
            <svg width="200" height="200">
                <circle r="70" cx="100" cy="100" fill="transparent" stroke="lightgrey" stroke-width="2rem"
                        stroke-dasharray="439.8" stroke-dashoffset="0"></circle>
                <circle r="70" cx="100" cy="100" fill="transparent" stroke="blue" stroke-width="2rem"
                        stroke-dasharray="439.8" stroke-dashoffset="66"></circle>
            </svg>
            <div className="report-number">{props.report.amount}</div>
            <h3 className="report-title">{props.report.name}</h3>
        </div>
    );
}

ReportBox.propTypes = {
    name: PropTypes.string,
    amount: PropTypes.number,
    type: PropTypes.string
};

export default ReportBox;
